interest:
Jsem PRO
- slušnost, férovost a spolehlivost v politice, médiích, kultuře, sportu a celé občanské společnosti, médiích, ale i v podnikání;
- přednost mravních / etických a ekologických hodnot před všemi ostatními;
- chápání politiky jakožto veřejné služby druhým lidem;
- rozhodování o věcech veřejných vždy s ohledem na dlouhodobý efekt pro společnost a přírodu;
- důraz na sociální a ekologický rozměr všech rozhodnutí;
- transparentnost, profesionalitu a otevřenou komunikaci při veškerém rozhodování o věcech veřejných a jejich správě;
- aktivizaci mladé a střední generace (které ponesou vážné důsledky chování dosavadních vlád);
- aktivizaci lidí a organizací s morální autoritou.
